import base64
import cv2
import boto3
import numpy as np
import os

def lambda_handler(event, context):


    s3 = boto3.client('s3')

    image_b64 = event["body"]
    nparr = np.frombuffer(base64.b64decode(image_b64), np.uint8)
    img = cv2.imdecode(nparr, cv2.IMREAD_COLOR)
    h, w, _ = img.shape
    # print(type(body))
    # print(body)

    bucket = 'video-inference-models'
    prototxt_file = 'deploy.prototxt.txt'
    caffe_file = "detect_faces.caffemodel"

    if not os.path.exists(prototxt_file):
        s3.download_file(bucket, prototxt_file, prototxt_file)
    if not os.path.exists(caffe_file):
        s3.download_file(bucket, caffe_file, caffe_file)

    model = cv2.dnn.readNetFromCaffe(prototxt_file,caffe_file)
    resized = np.array(cv2.resize(img, (300, 300)), dtype=np.uint8)
    blob = cv2.dnn.blobFromImage(resized, 1.0, (300, 300), (104.0, 177.0, 123.0))
    min_confidence = 0.3

    model.setInput(blob)
    detections = model.forward()

    boxes = []
    probabilities = []

    for i in range(0, detections.shape[2]):
        # extract the confidence (i.e., probability) associated with the
        # prediction
        confidence = detections[0, 0, i, 2]
        # filter out weak detections by ensuring the `confidence` is
        # greater than the minimum confidence
        if confidence > min_confidence:
            # compute the (x, y)-coordinates of the bounding box for the
            # object
            box = detections[0, 0, i, 3:7] * np.array([w, h, w, h])
            (startX, startY, endX, endY) = box.astype("int")
            boxes.append((startX, startY, endX, endY))
            probabilities.append(confidence)

    response = {
        "statusCode": 200,
        "headers": {},
        "body": {"probabilities": probabilities, "boxes": boxes}
    }

    return response

if __name__ == '__main__':

    im = ''
    ev = {"body": im}
    ans = lambda_handler(ev, {})
    print(ans)